import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <IntroText />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

function IntroText (){
  return (
    <p>
          Edit <code>src/App.js</code> sadasdasda and save to reload, SARASA.
        </p>
  ) 
}

export default App;
